import React, { useState, useEffect } from 'react';
import styled from 'styled-components';
import { FiUsers, FiFolder, FiActivity, FiFileText, FiSettings, FiBarChart3 } from 'react-icons/fi';
import { useAuth } from '../../contexts/AuthContext';
import LoadingSpinner from '../../components/UI/LoadingSpinner';
import AdminCard from '../../components/Admin/AdminCard';
import StatsChart from '../../components/Admin/StatsChart';
import RecentActivity from '../../components/Admin/RecentActivity';

const AdminDashboardContainer = styled.div`
  padding: 2rem;
  max-width: 1200px;
  margin: 0 auto;
`;

const Header = styled.div`
  margin-bottom: 2rem;
`;

const Title = styled.h1`
  font-size: 2rem;
  font-weight: 600;
  color: ${props => props.theme.colors.text};
  margin-bottom: 0.5rem;
`;

const Subtitle = styled.p`
  color: ${props => props.theme.colors.textMuted};
  font-size: 1rem;
`;

const StatsGrid = styled.div`
  display: grid;
  grid-template-columns: repeat(auto-fit, minmax(250px, 1fr));
  gap: 1.5rem;
  margin-bottom: 2rem;
`;

const ContentGrid = styled.div`
  display: grid;
  grid-template-columns: 2fr 1fr;
  gap: 2rem;
  margin-bottom: 2rem;

  @media (max-width: 768px) {
    grid-template-columns: 1fr;
  }
`;

const AdminDashboard = () => {
  const { user } = useAuth();
  const [stats, setStats] = useState(null);
  const [recentActivity, setRecentActivity] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    fetchAdminData();
  }, []);

  const fetchAdminData = async () => {
    try {
      setLoading(true);

      // Параллельные запросы для получения статистики
      const [statsResponse, activityResponse] = await Promise.all([
        fetch('/api/admin/stats', {
          headers: {
            'Authorization': `Bearer ${localStorage.getItem('token')}`
          }
        }),
        fetch('/api/admin/activity', {
          headers: {
            'Authorization': `Bearer ${localStorage.getItem('token')}`
          }
        })
      ]);

      if (!statsResponse.ok || !activityResponse.ok) {
        throw new Error('Ошибка загрузки данных');
      }

      const statsData = await statsResponse.json();
      const activityData = await activityResponse.json();

      setStats(statsData);
      setRecentActivity(activityData.activities);
    } catch (err) {
      setError(err.message);
      console.error('Ошибка загрузки админ данных:', err);
    } finally {
      setLoading(false);
    }
  };

  if (loading) {
    return <LoadingSpinner fullScreen />;
  }

  if (error) {
    return (
      <AdminDashboardContainer>
        <div style={{ textAlign: 'center', padding: '2rem' }}>
          <h2>Ошибка загрузки данных</h2>
          <p>{error}</p>
          <button onClick={fetchAdminData}>Попробовать снова</button>
        </div>
      </AdminDashboardContainer>
    );
  }

  return (
    <AdminDashboardContainer>
      <Header>
        <Title>Панель администратора</Title>
        <Subtitle>
          Добро пожаловать, {user?.name || user?.username}! 
          Управление системой UX/UI Lab
        </Subtitle>
      </Header>

      <StatsGrid>
        <AdminCard
          icon={<FiUsers />}
          title="Пользователи"
          value={stats?.users?.total || 0}
          subtitle={`+${stats?.users?.newThisMonth || 0} в этом месяце`}
          color="#4F46E5"
          link="/admin/users"
        />

        <AdminCard
          icon={<FiFolder />}
          title="Проекты"
          value={stats?.projects?.total || 0}
          subtitle={`${stats?.projects?.active || 0} активных`}
          color="#059669"
          link="/admin/projects"
        />

        <AdminCard
          icon={<FiActivity />}
          title="Анализы"
          value={stats?.analyses?.total || 0}
          subtitle={`${stats?.analyses?.completed || 0} завершено`}
          color="#DC2626"
          link="/admin/analyses"
        />

        <AdminCard
          icon={<FiFileText />}
          title="Отчёты"
          value={stats?.reports?.total || 0}
          subtitle={`${stats?.reports?.downloads || 0} скачиваний`}
          color="#7C3AED"
          link="/admin/reports"
        />
      </StatsGrid>

      <ContentGrid>
        <StatsChart data={stats?.chartData} />
        <RecentActivity activities={recentActivity} />
      </ContentGrid>
    </AdminDashboardContainer>
  );
};

export default AdminDashboard;
